    "2016-07-27T22:41:33.499639",nt"name": "metal-and-organic-residues-in-addled-eggs-of-least-terns-and-piping-plovers-in-the-platte-",nt"isopen":
    false,nt"url": null,nt"notes": "The concentration of most residues detected
    in eggs of least terns and piping plovers nesting in the Platte River valley are
    not a cause for alarm. However, selenium and mercury concentrations in addled eggs
    are a cause for concern. Selenium and mercury concentrations were elevated above
    background, and selenium in particular may be causing embryo mortality without gross
    embryological defects. More significantly, the impacts of contaminants combined
    with the physical degradation of habitat mat further accelerate population declines
    for both of these species.",nt"license_title": "License Not Specified",nt"extras":
